import React from "react";

import "../styles/reset.scss";
import "../styles/Catagaries.scss";

function Home() {
  return (
    <>
      <div className="homepage">
        <h1>Music for everyone</h1>
        <h2>millions of songs</h2>
        <section>
          <div className="flex-container">
            <div className="div first-div">one</div>
            <div className="div secound-div">two</div>
            <div className="div third-div">three</div>
            <div className="div fourth-div">four </div>
            <div className="div fifth-div">fifth</div>
            <div className="div sixth-div">sixth</div>
          </div>
        </section>
      </div>
    </>
  );
}

export default Home;
